script: |
  super -f text -I q12633.spq | sort > q12633.out

inputs:
  - name: q12633.spq
    data: |
      SELECT DISTINCT - col2 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT ( NULL ) NOT BETWEEN + + col0 AND - 82 * + CAST ( NULL AS INTEGER ) - - + col0 / 34 * + col1;
  - name: tab2

outputs:
  - name: q12633.out
    data: |
